#
# Structure for table "cabinet"
#

CREATE TABLE `cabinet` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `cabinet_no` varchar(50) DEFAULT NULL COMMENT '机柜编号',
  `name` varchar(30) NOT NULL DEFAULT '' COMMENT '名称',
  `cabinet_type_id` bigint(20) DEFAULT NULL COMMENT '类别id',
  `total_slots` int(11) NOT NULL DEFAULT '0' COMMENT '总插槽数量',
  `free_slots` int(11) NOT NULL DEFAULT '0' COMMENT '空闲插槽数量',
  `used_slots` int(11) NOT NULL DEFAULT '0' COMMENT '已使用插槽数量',
  `available_num` int(11) NOT NULL DEFAULT '0' COMMENT '可用充电宝数量',
  `description` varchar(500) DEFAULT NULL COMMENT '描述',
  `location_id` bigint(20) DEFAULT '1' COMMENT '当前位置id',
  `client_id` varchar(50) DEFAULT NULL COMMENT '设备id',
  `username` varchar(50) DEFAULT NULL COMMENT '用户名',
  `password` varchar(50) DEFAULT NULL COMMENT '密码',
  `status` char(1) NOT NULL DEFAULT '0' COMMENT '状态（0：未投入 1：使用中 -1：故障）',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=100 DEFAULT CHARSET=utf8mb4 COMMENT='充电宝柜机表';

