# Structure for table "cabinet_slot"
#

CREATE TABLE `cabinet_slot` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `cabinet_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '柜机id',
  `slot_no` varchar(10) NOT NULL DEFAULT '' COMMENT '插槽编号',
  `power_bank_id` bigint(20) DEFAULT NULL COMMENT '充电宝id',
  `status` char(1) NOT NULL DEFAULT '0' COMMENT '状态（1：占用 0：空闲 2：锁定）',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=797 DEFAULT CHARSET=utf8mb4 COMMENT='柜机插槽表';

