#
# Structure for table "power_bank"
#

CREATE TABLE `power_bank` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `power_bank_no` varchar(30) NOT NULL DEFAULT '' COMMENT '充电宝编号',
  `electricity` decimal(10,2) DEFAULT '0.00' COMMENT '电量',
  `description` varchar(500) DEFAULT '1' COMMENT '描述',
  `status` char(1) NOT NULL DEFAULT '0' COMMENT '状态（0:未投放 1：可用 2：已租用 3：充电中 4：故障）',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=782 DEFAULT CHARSET=utf8mb4 COMMENT='充电宝表';

