#
# Structure for table "station"
#

CREATE TABLE `station` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(100) NOT NULL DEFAULT '0' COMMENT '站点名称',
  `image_url` varchar(255) DEFAULT NULL COMMENT '站点图片地址',
  `business_hours` varchar(255) DEFAULT NULL COMMENT '营业时间',
  `longitude` decimal(10,7) NOT NULL DEFAULT '0.0000000' COMMENT '经度',
  `latitude` decimal(10,7) NOT NULL DEFAULT '0.0000000' COMMENT '纬度',
  `province_code` varchar(10) DEFAULT NULL,
  `city_code` varchar(10) DEFAULT NULL,
  `district_code` varchar(10) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL COMMENT '详细地址',
  `full_address` varchar(255) DEFAULT NULL COMMENT '完整地址',
  `head_name` varchar(20) DEFAULT NULL COMMENT '站点负责人名称',
  `head_phone` varchar(11) DEFAULT NULL COMMENT '站点负责人电话',
  `cabinet_id` bigint(20) DEFAULT NULL COMMENT '柜机id',
  `fee_rule_id` bigint(20) DEFAULT NULL COMMENT '费用规则id',
  `status` char(1) DEFAULT NULL COMMENT '状态（1正常 0停用）',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=100 DEFAULT CHARSET=utf8mb4 COMMENT='站点表';

