#
# Structure for table "order_info"
#

CREATE TABLE `order_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `user_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `nickname` varchar(50) DEFAULT NULL COMMENT '用户昵称',
  `order_no` varchar(50) NOT NULL DEFAULT '' COMMENT '订单号',
  `power_bank_no` varchar(50) DEFAULT NULL COMMENT '充电宝编号',
  `start_time` datetime DEFAULT NULL COMMENT '借用开始时间',
  `start_station_id` bigint(20) DEFAULT NULL COMMENT '借用站点id',
  `start_station_name` varchar(100) DEFAULT NULL COMMENT '借用地点名称',
  `start_cabinet_no` varchar(50) DEFAULT NULL COMMENT '借用柜机编号',
  `end_time` datetime DEFAULT NULL COMMENT '归还时间',
  `end_station_id` bigint(20) DEFAULT NULL COMMENT '归还站点id',
  `end_station_name` varchar(100) DEFAULT NULL COMMENT '归还地点名称',
  `end_cabinet_no` varchar(50) DEFAULT NULL COMMENT '归还柜机编号',
  `duration` int(11) DEFAULT NULL COMMENT '借用时长',
  `fee_rule` varchar(200) DEFAULT NULL COMMENT '费用规则',
  `fee_rule_id` bigint(20) DEFAULT NULL COMMENT '费用规则id',
  `total_amount` decimal(10,2) DEFAULT '0.00' COMMENT '总金额',
  `deduct_amount` decimal(10,2) DEFAULT '0.00' COMMENT '抵扣金额',
  `real_amount` decimal(10,2) DEFAULT NULL COMMENT '实际订单金额',
  `pay_time` datetime DEFAULT NULL COMMENT '微信付款时间',
  `transaction_id` varchar(50) DEFAULT NULL COMMENT '微信支付订单号',
  `status` char(1) NOT NULL DEFAULT '1' COMMENT '订单状态：0:充电中 1：未支付 2：已支付',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `update_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8mb4 COMMENT='订单表';

