  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `coupon_id` bigint(20) DEFAULT NULL COMMENT '优惠券ID',
  `user_id` bigint(20) DEFAULT NULL COMMENT '乘客ID',
